import React from 'react'
import { Form } from 'react-bootstrap'

const Schedule = () => {
    return (
        <div>
            <Form>
                <Form.Group>
                    <Form.Label>When would you like to schedule with us:</Form.Label>
                    <Form.Control type="text"/>
                </Form.Group>
            </Form>
        </div>
    )
}

export default Schedule;
